void drawSquare(int x, int y, short int color){
//draw_line(int x0, int y0, int x1, int y1, short int color)
	draw_line(x*30,y*30,(x*30)+30,y*30,color);//top horizontal line
	draw_line(x*30,y*30+1,(x*30)+30,y*30+1,color);//top horizontal line
	draw_line(x*30,(y*30)+29,(x*30)+30,(y*30)+29,color);//bottom horizontal line
	draw_line(x*30,(y*30)+28,(x*30)+30,(y*30)+28,color);//bottom horizontal line
	draw_line(x*30,y*30,x*30,(y*30)+30,color);//left vertical
	draw_line(x*30+1,y*30,x*30+1,(y*30)+30,color);//left vertical
	draw_line((x*30)+29,y*30,(x*30)+29,(y*30)+30,color);//right vertical
	draw_line((x*30)+28,y*30,(x*30)+28,(y*30)+30,color);//right vertical
}

