void printBoard(){
	///printing the board with the pieces can wrap into a function if you want
	for (int i=7; i>=0; i--) {
        for (int j=0; j<8; j++) {
            printf("%3d", board[j][i][1]);
        }
        printf("\n");
    }
	for(int x = 0; x < 8; x++){
		for(int y = 0; y < 8; y++){
				switch(board[x][y][1]){//check unit
					case -1: // empty
						if((x+y)%2==0){//white grid
							lightbg(x,y);
						}else{//black grid
							darkbg(x,y);
						}
						break;
					case 0: // pawns
						if((x+y)%2==0){//white grid
							if(board[x][y][0]==1){//white pawn
								whitepawnlightbg(x,y);
							}else{
							blackpawnlightbg(x,y);//whitegridblackpawn
							}
						}else{//black grid
							if(board[x][y][0]==1){//white pawn
								whitepawndarkbg(x,y);
							}else{
							blackpawndarkbg(x,y);//blackgridblackpawn
							}
						}
						break;
					case 1: // rook
						if((x+y)%2==0){//white grid
							if(board[x][y][0]==1){//white pawn
								whiterooklightbg(x,y);
							}else{
							blackrooklightbg(x,y);//whitegridblackpawn
							}
						}else{//black grid
							if(board[x][y][0]==1){//white pawn
								whiterookdarkbg(x,y);
							}else{
							blackrookdarkbg(x,y);//blackgridblackpawn
							}
						}
						break;
					case 2: // knight
						if((x+y)%2==0){//white grid
							if(board[x][y][0]==1){//white pawn
								whiteknightlightbg(x,y);
							}else{
							blackknightlightbg(x,y);//whitegridblackpawn
							}
						}else{//black grid
							if(board[x][y][0]==1){//white pawn
								whiteknightdarkbg(x,y);
							}else{
							blackknightdarkbg(x,y);//blackgridblackpawn
							}
						}
						break;
					case 3: // bishop
						if((x+y)%2==0){//white grid
							if(board[x][y][0]==1){//white pawn
								whitebishoplightbg(x,y);
							}else{
							blackbishoplightbg(x,y);//whitegridblackpawn
							}
						}else{//black grid
							if(board[x][y][0]==1){//white pawn
								whitebishopdarkbg(x,y);
							}else{
							blackbishopdarkbg(x,y);//blackgridblackpawn
							}
						}
						break;
					case 4: // queen
						if((x+y)%2==0){//white grid
							if(board[x][y][0]==1){//white pawn
								whitequeenlightbg(x,y);
							}else{
							blackqueenlightbg(x,y);//whitegridblackpawn
							}
						}else{//black grid
							if(board[x][y][0]==1){//white pawn
								whitequeendarkbg(x,y);
							}else{
							blackqueendarkbg(x,y);//blackgridblackpawn
							}
						}
						break;
					case 5: // king
						if((x+y)%2==0){//white grid
							if(board[x][y][0]==1){//white pawn
								whitekinglightbg(x,y);
							}else{
							blackkinglightbg(x,y);//whitegridblackpawn
							}
						}else{//black grid
							if(board[x][y][0]==1){//white pawn
								whitekingdarkbg(x,y);
							}else{
							blackkingdarkbg(x,y);//blackgridblackpawn
							}
						}
						break;
					default:
						break;
				}
		}
	}

}

// code not shown for clear_screen() and draw_line() subroutines

void draw_line(int x0, int y0, int x1, int y1, short int color){
	//bool is_steep;
	bool is_steep = abs(y1-y0)>abs(x1-x0) ;//1 is true, 0 is false
	
	if (is_steep){
	swap(&x0,&y0);
	swap(&x1,&y1);
	}
	
	if (x0>x1){
	swap(&x0,&x1);
	swap(&y0,&y1);
	}

	int deltax = x1-x0;
	int deltay = abs(y1-y0);
	int error = (deltax/2)*(-1);
	int y = y0;
	int y_step = y0<y1?1:-1;
	
	
	for(int x = x0; x<x1;x++){
		if(is_steep){
		plot_pixel(y,x,color);
		}else{
		plot_pixel(x,y,color);
		}
		
		error = error+deltay;
		if(error>0){
		y = y+y_step;
		error = error-deltax;
		}
	}
	return; //maybe draw pixel and plot pixel arent the same
}

void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
	return;
}

void swap(int *x, int *y) {

   int temp;

   temp = *x; /* save the value of x */
   *x = *y;    /* put y into x */
   *y = temp; /* put temp into y */
  
   return;
}

void clear_screen(){
for(int x = 0; x < 320; x++){
	for(int y = 0; y < 240; y++){
		plot_pixel(x,y,0x0);
		}
	}
}

void blackbg(){
for(int x = 0; x < 30; x++){
	for(int y = 0; y < 120; y++){
	plot_pixel(x+30*9,y+30*2,0x0);	
		}
	}
	
}

void darkbg(int i, int j){
for(int x = 0; x < 30; x++){
	for(int y = 0; y < 30; y++){
	plot_pixel(x+30*i,y+30*j,0x006400);	
		}
	}
	
}

void lightbg(int i, int j){

for(int x = 0; x < 30; x++){
	for(int y = 0; y < 30; y++){
	plot_pixel(x+30*i,y+30*j,0xa7ae);
		}
	}
	
}

